import {
  CategoryScale,
  Chart as ChartJS,
  Filler,
  Legend,
  LinearScale,
  LineElement,
  PointElement,
  Title,
  Tooltip
} from 'chart.js';
import React, { useEffect, useState } from 'react';
import { Line } from 'react-chartjs-2';
import '../styles/UserAccessGraph.css';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
);

function UserAccessGraph() {
  const [accessData, setAccessData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [timeRange, setTimeRange] = useState('24h');

  useEffect(() => {
    // Using the exact data provided
    const mockData = [
      { user: 'John Doe', lastAccess: '2024-03-15T10:00:00', app: 'Dover Portal' },
      { user: 'Jane Smith', lastAccess: '2024-03-15T11:30:00', app: 'GitHub' },
      { user: 'Bob Johnson', lastAccess: '2024-03-15T09:15:00', app: 'HR Portal' },
      { user: 'Alice Brown', lastAccess: '2024-03-15T14:20:00', app: 'DevOps Portal' },
      { user: 'Charlie Wilson', lastAccess: '2024-03-15T15:45:00', app: 'Finance Portal' },
      { user: 'Emma Davis', lastAccess: '2024-03-15T16:30:00', app: 'Dover Portal' },
      { user: 'Frank Miller', lastAccess: '2024-03-15T13:10:00', app: 'GitHub' },
      { user: 'Grace Lee', lastAccess: '2024-03-15T12:00:00', app: 'HR Portal' },
      { user: 'Henry Taylor', lastAccess: '2024-03-15T17:15:00', app: 'DevOps Portal' },
      { user: 'Ivy Martinez', lastAccess: '2024-03-15T18:00:00', app: 'Finance Portal' }
    ];
    setAccessData(mockData);
    setLoading(false);
  }, []);

  const chartData = {
    labels: accessData.map(item => item.user),
    datasets: [
      {
        label: 'Last Access Time',
        data: accessData.map(item => new Date(item.lastAccess).getTime()),
        borderColor: 'rgb(99, 102, 241)',
        backgroundColor: 'rgba(99, 102, 241, 0.1)',
        tension: 0.4,
        pointRadius: 6,
        pointHoverRadius: 8,
        pointBackgroundColor: 'rgb(99, 102, 241)',
        pointBorderColor: '#fff',
        pointBorderWidth: 2,
        fill: true,
      },
    ],
  };

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    interaction: {
      mode: 'index',
      intersect: false,
    },
    plugins: {
      legend: {
        position: 'top',
        labels: {
          color: 'var(--text-color)',
          font: {
            size: 14,
            family: 'var(--font-family-base)',
          },
          padding: 20,
          usePointStyle: true,
          pointStyle: 'circle',
        },
      },
      title: {
        display: true,
        text: 'User Access Activity',
        color: 'var(--text-color)',
        font: {
          size: 18,
          weight: 'bold',
          family: 'var(--font-family-base)',
        },
        padding: {
          top: 10,
          bottom: 30
        }
      },
      tooltip: {
        backgroundColor: 'rgba(0, 0, 0, 0.8)',
        titleColor: '#fff',
        bodyColor: '#fff',
        borderColor: 'rgba(255, 255, 255, 0.1)',
        borderWidth: 1,
        padding: 12,
        cornerRadius: 8,
        callbacks: {
          label: function(context) {
            const date = new Date(context.raw);
            const user = accessData[context.dataIndex];
            return [
              `User: ${user.user}`,
              `Last Access: ${date.toLocaleString()}`,
              `Application: ${user.app}`
            ];
          },
        },
      },
    },
    scales: {
      x: {
        grid: {
          display: false,
        },
        ticks: {
          color: 'var(--text-color)',
          font: {
            size: 12,
            family: 'var(--font-family-base)',
          },
          maxRotation: 45,
          minRotation: 45,
          padding: 10,
        },
      },
      y: {
        grid: {
          color: 'rgba(128, 128, 128, 0.1)',
          drawBorder: false,
        },
        ticks: {
          color: 'var(--text-color)',
          font: {
            size: 12,
            family: 'var(--font-family-base)',
          },
          padding: 10,
          callback: function(value) {
            return new Date(value).toLocaleTimeString();
          },
        },
      },
    },
  };

  if (loading) {
    return <div className="loading">Loading access data...</div>;
  }

  return (
    <div className="user-access-graph-container">
      <div className="graph-header">
        <h3>User Access Activity</h3>
        <div className="time-range-selector">
          <button 
            className={`time-button ${timeRange === '24h' ? 'active' : ''}`}
            onClick={() => setTimeRange('24h')}
          >
            24h
          </button>
          <button 
            className={`time-button ${timeRange === '7d' ? 'active' : ''}`}
            onClick={() => setTimeRange('7d')}
          >
            7d
          </button>
          <button 
            className={`time-button ${timeRange === '30d' ? 'active' : ''}`}
            onClick={() => setTimeRange('30d')}
          >
            30d
          </button>
        </div>
      </div>
      <div className="graph-wrapper">
        <Line data={chartData} options={options} />
      </div>
    </div>
  );
}

export default UserAccessGraph;
